import "./App.css";
import { useState, useEffect, useRef } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import LoginPage from "./pages/LoginPage";
import RegisterPage from "./pages/RegisterPage";
import ProfilePage from "./pages/ProfilePage";
import Header from "./components/Header";
import UploadProductPage from "./pages/UploadProductPage";
import AllProdPage from "./pages/AllProdPage";
import SingleProduct from "./components/SingleProduct";

function App() {
  const [logedUser, setLogedUser] = useState({});
  const [products, setProducts] = useState([]);
  const [nupirkta, setNupirkta] = useState([]);
  useEffect(() => {
    fetch("http://localhost:4000/checkbasket")
      .then((res) => res.json())
      .then((data) => {
        setProducts(data.products);
        console.log(data.products);
      });
  }, []);

  return (
    <div className="App d-flex flex-column">
      <BrowserRouter>
        <Header nupirkta={nupirkta} />
        <Routes>
          <Route
            path="/login"
            element={<LoginPage setLogedUser={setLogedUser} />}
          />
          <Route path="/" element={<RegisterPage />} />
          <Route
            path="/profile"
            element={
              <ProfilePage logedUser={logedUser} setLogedUser={setLogedUser} />
            }
          />
          <Route
            path="/uploadProduct"
            element={<UploadProductPage logedUser={logedUser} />}
          />
          <Route
            path="/allProducts"
            element={
              <AllProdPage products={products} setProducts={setProducts} />
            }
          />
          <Route
            path="/singleProduct/:id"
            element={
              <SingleProduct
                products={products}
                logedUser={logedUser}
                setNupirkta={setNupirkta}
              />
            }
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
